const OrderOnline = () => {
    // Dummy data for products
    const products = [
      { id: 1, name: "Fondant Wedding Cake", description: "A sophisticated wedding cake covered in smooth fondant icing.", image: weddingCakeImage },
      { id: 2, name: "Birthday Cake", description: "Fun birthday cake", image: birthdayCakeImage },
      { id: 3, name: "Baby Shower Cake", description: "Adorable baby shower cake", image: babyShowerCakeImage }
      // Add more products as needed
    ];
  
    return (
      <div className="order-online-container">
        <header className="header">
          <div className="header-content">
            <h1>Welcome to faiths store</h1>
            <p>Shop now for the latest trends!</p>
          </div>
        </header>
        <main className="main-content">
          <section className="product-list">
            {products.map(product => (
              <div key={product.id} className="product-item">
                <img src={product.image} alt="Product" />
                <h2>{product.name}</h2>
                <p>{product.description}</p>
                <button className="btn-buy">Buy Now</button>
              </div>
            ))}
          </section>
          <section className="sidebar">
            <div className="sidebar-content">
              <h2>Categories</h2>
              <ul>
                {/* Assume you have categories from Products.js */}
                <li><Link to="/cakes">Cakes</Link></li>
                <li><Link to="/muffins">Muffins</Link></li>
                <li><Link to="/doughnuts">Doughnuts</Link></li>
                {/* Add more categories dynamically */}
              </ul>
            </div>
          </section>
        </main>
        <footer className="footer">
          <p>&copy; 2024 faiths store. All rights reserved.</p>
        </footer>
      </div>
    );
  }
  
  export default OrderOnline;
